import React from 'react'

const Pagination = () => {
  return (
    <ReactPaginate
    breakLabel="..."
    nextLabel="next >"
    onPageChange={event => console.log(event)}
    pageRangeDisplayed={4}
    pageCount={3}
    previousLabel="< previous"
    renderOnZeroPageCount={null}
  />

  )
}

export default Pagination
